elements.expression:
filters
| essql query="SELECT sprites.front_default AS img FROM \"pokemon*\" LIMIT 1"
| filterrows {getCell "img"}
| markdown "{{#each rows}}

![IMAGEM](data:image/png;base64,{{img}})

{{/each}}"
| render css=".canvasRenderEl{
}

.canvas__element {
    transform: scale(1.2);
}"

filters
| essql query="SELECT name FROM \"pokemon*\" LIMIT 1"
| markdown "{{#each rows}}

**Nome:** {{name}}

{{/each}}" 
  font={font family="'Open Sans', Helvetica, Arial, sans-serif" size=18 align="left" color="#000000" weight="normal" underline=false italic=false}
| render

filters
| essql query="SELECT base_experience AS xp FROM \"pokemon*\""
| markdown "{{#each rows}}

EXP {{xp}}

{{/each}}" 
  font={font family="'Open Sans', Helvetica, Arial, sans-serif" size=12 align="center" color="#000000" weight="bold" underline=false italic=false}
| render

filters
| essql query="SELECT type_name AS tipo FROM \"pokemon*\" LIMIT 1"
| markdown "{{#each rows}}

**Tipo:** {{tipo}}

{{/each}}"
| render

filters
| essql query="SELECT height  AS altura, weight AS peso FROM \"pokemon*\" LIMIT 1"
| markdown "{{#each rows}}

**Altura:** {{altura}}
**Peso:** {{peso}}

{{/each}}"
| render

filters
| essql query="SELECT ability_name AS habilidade FROM \"pokemon*\" LIMIT 1"
| markdown "{{#each rows}}

**Habilidade:** {{habilidade}}

{{/each}}"
| render
